import React from "react";
import { Link, useNavigate, useParams } from "react-router-dom";
import Header from "../../components/header/Header";
import useFetch from "../../hooks/useFetch";
import { IShippingResponse } from "../../interface";

function ShippingDetails() {
  const { id } = useParams();
  const { data, loading, error } = useFetch<IShippingResponse>(
    `http://localhost:8080/api/user/shipping/${id}`
  );
  console.log("data listCustom", data);
  //   console.log(data?.data.address.full_address, "=========================");
  return (
    <div className="container">
      <Header />
      <Link to="/shipping">
        <button className="btn btn-success">Back</button>
      </Link>
      {error ? <p>Error</p> : null}
      {loading ? (
        <p>Loading</p>
      ) : (
        <div className="container container-fluid">
          <div className="card">
            <div className="card-header">Shipping Details</div>
            <div className="card-body">
              <h5 className="card-title">Special title treatment</h5>
              <div className="d-flex">
                <div className="p-2 flex-grow-1">
                  <p>Shipping ID: {id}</p>
                  <p>{data?.data.address.recipient_name}</p>
                  <p>{data?.data.address.full_address}</p>
                  <p>{data?.data.category.name}</p>
                </div>
                <div className="p-2">
                  <h2>{data?.data.size.name}</h2>
                  <h2>{data?.data.add_on.name}</h2>
                </div>
              </div>
              <a href="#" className="btn btn-primary">
                Payments
              </a>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default ShippingDetails;
